import React, { Component } from "react";

class Photo extends Component {
	render() {
		console.log("urlllllll" + this.props.url);
		return (
			<div>
				<h4>img</h4>
				<img alt="test" src={this.props.url}></img>
			</div>
		);
	}
}

export default Photo;
